import { React, useContext } from 'react'
import { ThemeContext } from '../context/ThemeContext'

const Logo = () => {

  const darkMode = useContext(ThemeContext)

  return (
    <div className={`text-36 w-16 h-16 font-black ${`${darkMode ? darkMode : 'text-white bg-gradient-to-br from-cyan-500 to-purple-400'}`} flex justify-center items-center rounded-lg border-solid border-4 border-purple-700`}>
      <p>TUX</p>
    </div>
  )
}

export default Logo

